      | 364178 -> { ItemTypeData.id= 364178; name= "'Black Eagle' Scout G/1-Series"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. This variant of the A-Series Scout dropsuit was specifically requested by the Federal Intelligence Office’s Special Department of Internal Investigations and was tailored to their needs for front line military operations and peacekeeping duty within the Gallente Federation.  The entire suit is wrapped in un-polished matte black crystalline carbonide armor plates, in homage to the “Black Eagles” nickname that the Special Department of Internal Investigation has become known by. Every armor plate attached to the suit is wrapped in an energized adaptive nano membrane designed to deflect small arms fire and absorb the force of incoming plasma based projectiles, neutralizing their ionization and reducing their ability to cause thermal damage.  Building on the original design, the standard fusion core is replaced with a wafer thin seventh generation Duvolle Laboratories T-3405 fusion reactor situated between the user’s shoulder blades to power the entire suit. Given requests from the Federal Intelligence Office for a suit that could outperform anything else in its class when worn by a well-trained user, Poteque Pharmaceuticals were drafted in to create custom kinetic monitoring equipment and a servo assisted movement system specifically tailored to this suit. Finally, to meet the operational demands of the Special Department of Internal Investigation the suit has undergone heavy modifications to allow mounting of two light weapon systems at the expense of support module capacity. "; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 364566 -> { ItemTypeData.id= 364566; name= "'Templar' Logistics A-I"; published= false; description= "Few have heard of the Thirteen, but this suit is proof of the Templars’ existence. First-generation tech that, while crude, remains as brutally effective as anything available on the battlefield today. The suit’s original form is considered immaculate, the perfect amalgam of science and religion, embellished only slightly as befitting of the first Templars’ status. Inscribed within each suit, unseen but felt, are passages from the Scriptures, The Word that guides the hand of all True Amarr."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
