      | 36512 -> { ItemTypeData.id= 36512; name= "Women's 'Hephaestus' Shoes (white/red)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   These functional but high tech shoes retain the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each pair of shoes are crafted from white and red materials and fabrics that are extremely durable yet comfortable enough to wear for extended periods."; marketGroupId= Some(1404); groupId= 1091; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365633 -> { ItemTypeData.id= 365633; name= "'Construct' Imperial Scrambler Rifle"; published= false; description= "The scrambler rifle is a selective-fire weapon capable of semi-automatic and charged fire. Each shot produces a pulse of sinuous energy capable of penetrating shield and metal. By keeping pressure on the trigger, the operator can control the power of each discharge, scaling it to produce an intense pulse of energy fatal to soft targets.    The added power output does come with downsides, most notably increased heat build-up; left unmanaged, thermal stresses age the focusing crystal prematurely, resulting in splintering and potentially lethal feedback. Despite this and several other issues – increased heft, poor reliability, and high manufacturing cost – the scrambler rifle is widely available and in service on battlefields clusterwide."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365924 -> { ItemTypeData.id= 365924; name= "Passive Booster (1-Day)"; published= false; description= "Boosters are biomechanical grafts designed to stimulate nerve growth and neurotransmitter activity, temporarily increasing cognitive processes. The graft will degrade over time until it is completely absorbed by the body and ceases to function.    NOTE: Passive boosters will continue to function on non-primary clones as a factor of the base skillpoint accrual rate. (Non-primary clones without a passive skill booster do not accrue skill points at all.)"; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
