      | 48734 -> { ItemTypeData.id= 48734; name= "Phoenix Caldari Union Day SKIN"; published= true; description= "The Caldari State Workers Union is the single official workers organization that operates on a pan-state basis and is affiliated to by the workers organizations of all of the  Big 8  megacorps of the Caldari State. The State Workers Union concerns itself primarily with promoting good inter-megacorp relations between workers below the executive level throughout the Caldari State.    A major portion of its work involves running vacation trips for working families that wish to experience the variety of Caldari society as expressed in different megacorporations. The highlight of the calendar for many Caldari workers is the Caldari Executive Panel mandated State Workers Union Day, one of the few universally observed public holidays in the State. Promotion of the virtues of honestly earned leisure time is exemplified in a special nanocoating that celebrates Union Day, with the proceeds going to the State Workers Union Orphans Apprenticeship Fund."; marketGroupId= Some(1981); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 48831 -> { ItemTypeData.id= 48831; name= "Zealot Cordite Blossom SKIN"; published= true; description= "Released as a tribute to a renowned Imperial Armaments weapons designer who was lost in battle during live field testing in mid YC120, this nanocoating was produced in limited numbers for just eight hulls that have drawn influence (either directly or more controversially) from his highly successful design work over the years.     The fade from deep black to vibrant yellow pays homage to the color produced by Standard frequency crystals, which are used in weapons testing to form a baseline damage profile for prototype energy turrets. The nanocoating is also adorned with a crest of crimson roses, the symbol of the Imperial house to which he belonged.     Among the hulls that this nanocoating was commissioned for is the Punisher, the staple anti-frigate and fighter patrol platform of the Imperial Navy, which is widely regarded as one of the finest examples of a light turret-based weapons platform ever designed.     “To serve your craft with such skill and tenacity is worthy of the deepest reverence. To pour your very heart and soul into your work is truly divine.”     Kefsooda Arkih, - CEO, Imperial Armaments."; marketGroupId= Some(2069); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
